import React from 'react';

const FormRenderer = ({ questions }) => {
  return (
    <div className="form-renderer">
      {questions.map((question, index) => {
        if (question.type === 'categorized') {
          return (
            <div key={index}>
              <h3>{question.data.questionText}</h3>
              <div>
                {question.data.categories.map((category, categoryIndex) => (
                  <div key={categoryIndex}>
                    <h4>{category.name}</h4>
                    <ul>
                      {category.items.map((item, itemIndex) => (
                        <li key={itemIndex}>{item}</li>
                      ))}
                    </ul>
                  </div>
                ))}
              </div>
              <div>
                <h4>Options</h4>
                <ul>
                  {question.data.options.map((option, optionIndex) => (
                    <li key={optionIndex}>{option}</li>
                  ))}
                </ul>
              </div>
            </div>
          );
        } else if (question.type === 'cloze') {
          return (
            <div key={index}>
              <h3>{question.data.questionText}</h3>
              <p>
                {question.data.questionText.split(' ').map((word, idx) => {
                  if (word.startsWith('___')) {
                    return <span key={idx} className="underline">___</span>;
                  } else {
                    return <span key={idx}>{word} </span>;
                  }
                })}
              </p>
            </div>
          );
        } else if (question.type === 'comprehension') {
          return (
            <div key={index}>
              <h3>{question.data.questionText}</h3>
              <div>
                {question.data.options.map((option, optionIndex) => (
                  <div key={optionIndex}>
                    <input
                      type="radio"
                      name={`q${index}`}
                      value={option}
                    />
                    <label>{option}</label>
                  </div>
                ))}
              </div>
            </div>
          );
        }
        return null;
      })}
    </div>
  );
};

export default FormRenderer;
